import {
    Link,
    NavLink
  } from "react-router-dom";

class Login extends Component {
    render() {
        return (
            <div>
                Hello đây là login
                <NavLink className="nav-link" to="/res">Tin chi tiết</NavLink>
            </div>
        );
    }
}

export default Login;
